import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { incrementByAmount, decrement, increment } from './counter';
import { useNavigate } from 'react-router-dom';
export default function Summary() {
  const isAddOnName = useSelector((state) => state.counter.addOns.name);
  const isAddOnCost = useSelector((state) => state.counter.addOns.cost);
  const isAddOnText = useSelector((state) => state.counter.addOns.text);
  const isPlanName = useSelector((state) => state.counter.name);
  const isPlanPrice = useSelector((state) => state.counter.value);
  const isPlanType = useSelector((state) => state.counter.plan);
  const total = isPlanPrice + isAddOnCost;
  console.log(isAddOnName);

  return (
    <form>
      <div className="content">
        <div className="content-text">
          <h1>Finishing up</h1>
          <p>Double-check everything looks OK before confirming</p>
        </div>
        <div className="summary-box">
          <div className="summary-text">
            <h2>
              {isPlanName} ({isPlanType})
            </h2>
            <button>change</button>
            <p>{isPlanPrice}</p>
          </div>
          <div className="summary-addon"></div>
        </div>
      </div>
    </form>
  );
}
